    return (
        // Percebe minha props fica muito repetido, entáo para n acontecer isso vou passar um objeto
        <div>
            <img src={props.foto} alt={props.nome}/>
            <h2>nome: {props.nome}</h2>
            <p>idade: {props.idade}</p>
            <p>profissao: {props.profissao}</p>
        </div>
    )
}

